import React from "react";
import FruitList from "./FruitList";
import Navbar from "./Navbar";

function Home({ fruits }) {
  return (
    <div>
      <Navbar />
      <FruitList />
      <h2> Filter foods</h2>
      <FruitList
        fruits={fruits.filter(
          (fruit) => fruit.category_url === "/shop/categories/Fruits"
        )}
      />
    </div>
  );
}

export default Home;
